    <script>
        let c_global;
        function createHandler(c, i) {
            eval(`document.querySelector("#btn${i+1}").onclick =
                function() {
                    document.querySelector("#container").innerHTML =
                        "<center><h1>Oyunuz işleniyor, lütfen bekleyin.</h1></center>";                
                    google.script.run.withSuccessHandler(function(e) {
                        if (e) {
                            document.querySelector("#container").innerHTML =
                            "<center><h1>Oyunuz başarıyla kaydedildi.</h1></center>";
                        } else {
                            document.querySelector("#container").innerHTML =
                            "<center><h1>Bir sorun oluştu, eğer sorun devam ederse benimle (Yasir) iletişime geçin.</h1></center>";
                        }
                    }).oyVer("${c[i][0]}");
            }`);
        }
        function oyver(c) {
            google.script.run.withSuccessHandler(function(e) {
                if (e) {
                    document.querySelector("#container").innerHTML =
                    "<center><h1>Oyunuz başarıyla kaydedildi!</h1></center>";
                } else {
                    document.querySelector("#container").innerHTML =
                    "<center><h1>Bir sorun oluştu, eğer sorun devam ederse benimle (Yasir) iletişime geçin.</h1></center>"
                }
            }).oyVer(c[i][0]);
        }
        const ticket = google.script.run.withSuccessHandler(function(e) {
            return e;
        }).getTicket();
        google.script.run.withSuccessHandler(function(a) {
            if (!a) {
                document.querySelector("#container").innerHTML =
                `<center><h1>Lütfen geçerli bir bilet girin!</h1></center>`;
            } else {
                google.script.run.withSuccessHandler(function(b) {
                    if (!b) {
                        document.querySelector("#container").innerHTML =
                        `<center><h1>Bu bilet kullanılmış.</h1></center>`;
                    } else {
                        google.script.run.withSuccessHandler(function(c) {
                            c_global = c;
                            document.querySelector("#container").innerHTML =
                                "<h1>Oy vereceğiniz adayı seçin.</h1>"
                        for (let i = 0; i < c.length; i++) {
                            document.querySelector("#container").innerHTML +=
                                `<input id="btn${i+1}" type="button"
                                value="${c[i][0]} | ${c[i][1]}"><br>`;
                        } for (let i = 0; i < c.length; i++) {
                            createHandler(c, i);
                        }
                    }).getAdaylar();
                    }
                }).controlTicketCell();
            }
        }).controlTicket();
    </script>
